//import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import {Navbar,Nav} from 'react-bootstrap';
import Home from "./components/Home";
import RestaurantDetail from "./components/RestaurantDetail";
import RestaurantSearch from "./components/RestaurantSearch";
import RestaurantUpdate from "./components/RestaurantUpdate";
import RestaurantList from "./components/RestaurantsList";
import RestaurantCreate from "./components/RestaurantCreate";
import background from "./components/restro3.jpg";



function App() {

  return (
    <div className="App">
     <div style={{ backgroundImage: `url(${background})` }}>  
     {/* </div>);
    } */}
      <Router>

      <Navbar bg="light" expand="lg">
    <Navbar.Brand href="#home">My Restro</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="me-auto">
        <Nav.Link href="#home"><Link to="/">Home</Link></Nav.Link>
        <Nav.Link href="#link"> <Link to="/list">List</Link></Nav.Link>
        <Nav.Link href="#link"><Link to="/create">Create</Link></Nav.Link>
        <Nav.Link href="#link">  <Link to="/search">Search</Link></Nav.Link>
        <Nav.Link href="#link"> <Link to="/update">Update</Link></Nav.Link>
         <Nav.Link href="#link"> <Link to="/detail">Detail</Link></Nav.Link> 
      </Nav>
    </Navbar.Collapse>
</Navbar> 
        <Route path="/list">
          <RestaurantList />
        </Route>
        <Route path="/create">
          <RestaurantCreate />
        </Route>
        <Route path="/search">
          <RestaurantSearch />
        </Route>
        <Route path="/update">
          <RestaurantUpdate />
        </Route>
        <Route path="/detail">
          <RestaurantDetail />
        </Route>
        <Route exact path="/">
          <Home />
        </Route>

      </Router>
      </div>
    </div>
    //  </div> 
    //  </div>
    ); 
  }
export default App;
